  input: TEXT,F3XA,,"The MoneyGram International Good Government Fund (PAC) filed
    a mid-year 2005 report that included contributions made to the PAC from January
    1, 2005 through June 30, 2005.  The PAC, however, erroneously omitted $3,465 worth
    of contributions (one itemized contribution for $500 and $2,965 of unitemized
    smaller contributions) from the mid-year 2005 report.  The additional contributions
    are hereby provided in the PAC's amended filing.  Also a charge of $78.86 was
    deducted from the PAC bank account on May 31, 2005 to pay for check printing charges.  This
    deduction was erroneously not reported in the mid-year 2005 filing.  The charge
    is hereby provided in this amended filing.  The PAC recognizes the importance
    of accurate and thorough bookkeeping and has kept detailed records that have been
    used to create the amended filings.  The PAC has created specific policies and
    procedures to ensure that errors of this nature do not happen in the future."
